import React from 'react'

const Recipies = (props) => {
    return (
        <>
            <h1>{props.title}</h1>  
            <img src={props.photo} alt="img" />
            {
                props.ingredient.map((item) => {
                    return(
                        <p>{item}</p>
                    )
                })
            }
        </>
    )
}

export default Recipies
